We can use the CYK algorithm.  Label positions 1…5 with their pre‑terminal NTs:

1: t75 ⇒ {NT28}  
2: t41 ⇒ {NT24}  
3: t37 ⇒ {NT16}  
4: t14 ⇒ {NT8}  
5: t31 ⇒ {NT17}  

Length‐2 spans give  
(2,3): NT24 NT16 ⇒ NT13  
(4,5): NT8 NT17 ⇒ NT26  

Length‐4 span (2–5): splitting at 3 gives NT13 NT26 ⇒ NT7  

Finally the full span (1–5): NT28 NT7 ⇒ S  

Since S appears in the top cell, the string is generated.  

